import React, { Component } from "react";
import "./Menuuser.css"



class Menuuser extends Component {
    constructor(props) {
       // super(props);
        this.state = {
          showgrave:false,
          showmydata:true,
          showmyintencion:false
            },

        
        this.handleshowgrave = this.handleshowgrave.bind(this);
        this.handlemydata = this.handlemydata.bind(this);
        this.handlemyintencion = this.handlemyintencion.bind(this);
    }
    componentDidMount = () => {}
    handleshowgrave = () => {

     

        this.setState({ showgrave:true,
                        showmydata:false,
                        showmyintencion:false});
    }
    handlemydata = () => {

        this.setState({ showgrave:false,
            showmydata:false,
            showmyintencion:true});
    }
    handlemyintencion = () => {

        this.setState({ showgrave:false,
            showmydata:false,
            showmyintencion:true});
    }

    render() {
        return(
            <div key={101}>
                <button key={102} onClick={this.handleshowgrave}>Pokaż moje kwatery</button>
                <button key={103} onClick={this.handlemydata}>Pokaż moje dane</button>
                <button key={104} onClick={this.handlemyintencion}>Pokaż moje dane</button>

            </div>
        )
           
        
    }

}

export default Menuuser
